<!DOCTYPE html>
<html>
<head>
  <style>
        :root {
            --primary-color: #2563eb;
            --secondary-color: #64748b;
            --success-color: #059669;
            --warning-color: #d97706;
            --danger-color: #dc2626;
            --neutral-color: #6b7280;
            --bg-primary: #ffffff;
            --bg-secondary: #f8fafc;
            --bg-accent: #f1f5f9;
            --border-color: #e2e8f0;
            --text-primary: #1e293b;
            --text-secondary: #64748b;
            --shadow-sm: 0 1px 2px 0 rgb(0 0 0 / 0.05);
            --shadow-md: 0 4px 6px -1px rgb(0 0 0 / 0.1), 0 2px 4px -2px rgb(0 0 0 / 0.1);
            --shadow-lg: 0 10px 15px -3px rgb(0 0 0 / 0.1), 0 4px 6px -4px rgb(0 0 0 / 0.1);
        }

        * {
            box-sizing: border-box;
        }

        body {
            padding: 12px;
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, 'Helvetica Neue', Arial, sans-serif;
            background-color: var(--bg-secondary);
            color: var(--text-primary);
            line-height: 1.6;
            margin: 0;
        }

        .container {
            max-width: 100%;
            margin: 0 auto;
            background-color: var(--bg-primary);
            border-radius: 12px;
            box-shadow: var(--shadow-lg);
            padding: 16px 32px;
        }

        h1, h2 {
            color: var(--text-primary);
            margin-bottom: 16px;
            font-weight: 600;
        }

        h1 {
            font-size: 2.25rem;
            margin: 8px 0;
            background: linear-gradient(135deg, var(--primary-color), var(--success-color));
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            background-clip: text;
        }

        h2 {
            font-size: 1.5rem;
            border-bottom: 2px solid var(--border-color);
            padding-bottom: 8px;
            margin-top: 20px;
        }

        h3 {
            font-size: 1.2rem;
            margin: 0 0 12px 0;
            font-weight: 600;
        }

        .subtitle {
            color: var(--text-secondary);
            font-size: 0.875rem;
            margin-bottom: 24px;
        }

        .stickyrow { 
            width: 3000px; 
        }

        /* Table styling */
        #tableContainer {
            overflow: auto;
            border-radius: 8px;
            border: 1px solid var(--border-color);
            box-shadow: var(--shadow-md);
            margin: 20px 0;
            max-height: 80vh;
        }

        table {
            table-layout: auto;
            border-collapse: separate;
            border-spacing: 0;
            width: auto;
        }

        table.small-table {
            width: auto;
        }

        table.large-table {
            width: auto;
        }
        
        /* Fixed first column and header */
        #crossTable th, #crossTable td {
            position: sticky;
            border: 1px solid var(--border-color);
        }
        
        /* Fixed header */
        #crossTable th {
            top: 0;
            z-index: 2;
            background: linear-gradient(135deg, var(--primary-color), #3b82f6);
            color: white;
            font-weight: 600;
            text-shadow: 0 1px 2px rgba(0,0,0,0.1);
        }
        
        /* Fixed first column */
        #crossTable th:first-child, #crossTable td:first-child {
            left: 0;
            z-index: 1;
            background: linear-gradient(135deg, var(--primary-color), #3b82f6);
            color: white;
            font-weight: 500;
        }
        
        #crossTable th:first-child {
            z-index: 3;
        }
        
        /* First column width */
        #crossTable th:first-child, #crossTable td:first-child {
            width: auto;
            white-space: nowrap;
        }

        /* Other columns - compact width */
        #crossTable th:not(:first-child), #crossTable td:not(:first-child) {
            width: 80px;
            min-width: 80px;
            max-width: 80px;
        }
        
        td, th {
            white-space: nowrap;
            overflow: hidden;
            text-overflow: ellipsis;
            text-align: center;
            padding: 8px 12px;
            font-size: 0.875rem;
            transition: all 0.2s ease;
        }

        td:hover:not(.black):not(:first-child) {
            background-color: var(--bg-accent) !important;
            transform: scale(1.02);
            z-index: 1;
            box-shadow: var(--shadow-md);
            cursor: pointer;
        }

        td:not(.black):not(:first-child) {
            cursor: pointer;
        }

        .stickycell { 
            background-color: var(--bg-accent);
        }
        
        /* Enhanced color scheme */
        td.white { 
            background-color: #f1f5f9; 
            color: var(--text-secondary);
        }
        td.yellow { 
            background-color: #fef3c7; 
            color: #92400e;
            font-weight: 500;
        }
        td.green { 
            background-color: #d1fae5; 
            color: #065f46;
            font-weight: 600;
        }
        td.red { 
            background-color: #fee2e2; 
            color: #991b1b;
            font-weight: 600;
        }
        td.black { 
            background-color: #1f2937; 
            color: #9ca3af;
            font-weight: 500;
        }


        /* Filter and Button Styling */
        .filter-section {
            background-color: var(--bg-accent);
            border-radius: 8px;
            padding: 12px 16px;
            margin: 8px 0;
            border: 1px solid var(--border-color);
        }

        .filter-options {
            display: flex;
            gap: 20px;
            flex-wrap: wrap;
            align-items: center;
        }

        .radio-group {
            display: flex;
            align-items: center;
            gap: 8px;
            padding: 8px 12px;
            border-radius: 6px;
            transition: all 0.2s ease;
            cursor: pointer;
        }

        .radio-group:hover {
            background-color: var(--bg-primary);
        }

        .radio-group input[type="radio"] {
            accent-color: var(--primary-color);
            margin: 0;
        }

        .radio-group label {
            cursor: pointer;
            font-weight: 500;
            color: var(--text-primary);
            margin: 0;
        }

        /* Button Styling */
        .btn {
            background: linear-gradient(135deg, var(--primary-color), #3b82f6);
            color: white;
            border: none;
            padding: 12px 20px;
            border-radius: 8px;
            font-weight: 500;
            cursor: pointer;
            transition: all 0.2s ease;
            font-size: 0.875rem;
            box-shadow: var(--shadow-sm);
            margin: 8px 0;
        }

        .btn:hover {
            transform: translateY(-1px);
            box-shadow: var(--shadow-md);
            background: linear-gradient(135deg, #1d4ed8, var(--primary-color));
        }

        .btn:active {
            transform: translateY(0);
        }

        .btn-secondary {
            background: linear-gradient(135deg, var(--secondary-color), #475569);
        }

        .btn-secondary:hover {
            background: linear-gradient(135deg, #475569, var(--secondary-color));
        }

        /* Sortable List Styling */
        #sortable {
            background-color: var(--bg-accent);
            border-radius: 8px;
            padding: 16px;
            margin: 16px 0;
            border: 1px solid var(--border-color);
            columns: 3;
            column-gap: 20px;
            column-fill: balance;
            list-style: decimal;
            list-style-position: inside;
        }

        #sortable li {
            background-color: var(--bg-primary);
            margin: 4px 0;
            padding: 8px 12px;
            border-radius: 4px;
            border: 1px solid var(--border-color);
            cursor: move;
            font-weight: 500;
            box-shadow: var(--shadow-sm);
            display: inline-block;
            width: 100%;
            break-inside: avoid;
            font-size: 0.875rem;
            position: relative;
        }

        #sortable li .player-controls {
            display: flex;
            align-items: center;
            justify-content: space-between;
            width: 100%;
        }

        #sortable li .player-rank {
            font-weight: 600;
            color: var(--primary-color);
            margin-right: 4px;
        }

        #sortable li .player-name {
            flex: 1;
            margin-right: 8px;
        }

        #sortable li .hide-btn {
            background-color: var(--danger-color);
            color: white;
            border: none;
            border-radius: 3px;
            padding: 2px 6px;
            font-size: 0.75rem;
            cursor: pointer;
            transition: all 0.2s ease;
        }

        #sortable li .hide-btn:hover {
            background-color: #b91c1c;
        }

        #sortable li.hidden {
            opacity: 0.5;
            background-color: var(--neutral-color);
        }

        #sortable li.hidden .hide-btn {
            background-color: var(--success-color);
        }

        #sortable li.hidden .hide-btn:hover {
            background-color: #047857;
        }

        #sortable li:hover {
            background-color: var(--bg-accent);
            box-shadow: var(--shadow-md);
        }

        #sortable li.ui-sortable-helper {
            background-color: var(--primary-color);
            color: white;
            box-shadow: var(--shadow-lg);
            width: auto;
        }

        .sortable-placeholder {
            background-color: var(--border-color);
            border: 2px dashed var(--primary-color);
            margin: 4px 0;
            height: 32px;
            border-radius: 4px;
            display: inline-block;
            width: 100%;
        }

        /* Collapsible Sections */
        .collapsible-section {
            background-color: var(--bg-accent);
            border-radius: 8px;
            margin: 20px 0;
            border: 1px solid var(--border-color);
            overflow: hidden;
        }

        .collapsible-content {
            padding: 20px;
            max-height: 300px;
            overflow-y: auto;
            background-color: var(--bg-primary);
        }

        .info-text {
            font-size: 0.875rem;
            color: var(--text-secondary);
            font-style: italic;
            margin: 8px 0;
        }

        /* Modal Styling */
        .modal {
            display: none;
            position: fixed;
            z-index: 1000;
            left: 0;
            top: 0;
            width: 100%;
            height: 100%;
            background-color: rgba(0, 0, 0, 0.5);
            backdrop-filter: blur(4px);
        }

        .modal-content {
            background-color: var(--bg-primary);
            margin: 5% auto;
            padding: 24px;
            border-radius: 12px;
            width: 80%;
            max-width: 600px;
            max-height: 80vh;
            overflow-y: auto;
            box-shadow: var(--shadow-lg);
            position: relative;
        }

        .modal-header {
            display: flex;
            justify-content: space-between;
            align-items: center;
            margin-bottom: 20px;
            padding-bottom: 12px;
            border-bottom: 2px solid var(--border-color);
        }

        .modal-title {
            font-size: 1.5rem;
            font-weight: 600;
            color: var(--text-primary);
            margin: 0;
        }

        .close {
            color: var(--text-secondary);
            font-size: 28px;
            font-weight: bold;
            cursor: pointer;
            line-height: 1;
            padding: 4px 8px;
            border-radius: 4px;
            transition: all 0.2s ease;
        }

        .close:hover {
            color: var(--danger-color);
            background-color: var(--bg-accent);
        }

        .match-item {
            background-color: var(--bg-accent);
            border-radius: 8px;
            padding: 12px 16px;
            margin: 8px 0;
            border-left: 4px solid var(--primary-color);
        }

        .match-winner {
            font-weight: 600;
            color: var(--success-color);
        }

        .match-loser {
            color: var(--text-secondary);
        }

        .match-score {
            font-weight: 500;
            color: var(--primary-color);
        }

        .match-event {
            font-size: 0.875rem;
            color: var(--text-secondary);
            font-style: italic;
            margin-top: 4px;
        }

        .no-matches {
            text-align: center;
            color: var(--text-secondary);
            font-style: italic;
            padding: 20px;
        }

    </style>

</head>

                <!-- This will be populated using JavaScript -->
            </div>
        </div>
    </div>

	function getFilteredMatches() {
	    var filter = $("input[name='filter']:checked").val();
	    var excludedRows = getExcludedRows();
	    var filteredMatches = matches.filter(function(match, index) {
		if (excludedRows.includes(index)) {
		    return false;
		}
		if (filter === "majorAndRegional") {
		    return match[6] === 'majors' || match[6] === 'regionals';
		}
		return filter == "all" || match[6] == filter;
	    });
	    return filteredMatches;
	}
      
        function createCrossTableData(filteredMatches) {
            var data = { };

            players.forEach(function(id) {
                data[id] = {};
                players.forEach(function(id2) {
                    data[id][id2] = id === id2 ? "0" : "0-0";
                });
            });

            filteredMatches.forEach(function(match) {
		console.log(match)
                var winnerId = match[1];
                var loserId = match[3];
                var score = match[4].split("-").reverse().join("-");  // swap winner-loser score
                
                // Update scores
                if (data[winnerId][loserId] == "0-0") data[winnerId][loserId] = "1-0";
                else {
                    var scores = data[winnerId][loserId].split("-");
                    scores[0] = (parseInt(scores[0]) + 1).toString();
                    data[winnerId][loserId] = scores.join("-");
                }

                if (data[loserId][winnerId] == "0-0") data[loserId][winnerId] = "0-1";
                else {
                    var scores = data[loserId][winnerId].split("-");
                    scores[1] = (parseInt(scores[1]) + 1).toString();
                    data[loserId][winnerId] = scores.join("-");
                }
            });

            return data;
        }

      function populateTable(crossTableData) {
            $("#crossTable").empty();
            var visiblePlayers = getVisiblePlayers();
            
            // Adjust table size based on number of visible players
            if (visiblePlayers.length <= 30) {
                $("#crossTable").removeClass("large-table").addClass("small-table");
            } else {
                $("#crossTable").removeClass("small-table").addClass("large-table");
            }
            
            var header = $("<tr>");
            header.append($("<th>").text("x"));
            visiblePlayers.forEach(function(id) {
                header.append($("<th>").addClass("cell stickycell").text(playersData[id]));
            });
            $("#crossTable").append(header);

            visiblePlayers.forEach(function(id) {
                var row = $("<tr>");
                row.append($("<td>").addClass("cell stickycell stickyrow").text(playersData[id]));
                visiblePlayers.forEach(function(id2) {
                    var cell = $("<td>").text(crossTableData[id][id2]);
                    if (id == id2) cell.addClass("black");  // diagonal
                    else {
                        var scores = crossTableData[id][id2].split("-");
	                var wins = parseInt(scores[0]);
	                var losses = parseInt(scores[1]);

	                if (wins == 0 && losses == 0) cell.addClass("white");
	                else if (wins == losses) cell.addClass("yellow");
	                else if (wins > losses) cell.addClass("green");
	                else if (wins < losses) cell.addClass("red");
                        
                        // Add click handler for showing matches
                        cell.attr("data-player1", id).attr("data-player2", id2);
                        cell.addClass("clickable-cell");
                    }
                    row.append(cell);
                });
                $("#crossTable").append(row);
            });
        }

        function getVisiblePlayers() {
            return players.filter(function(id) {
                return !$("#" + id).hasClass("hidden");
            });
        }

        function populatePlayerList() {
            $("#sortable").empty();
            players.forEach(function(id, index) {
                var li = $("<li>").addClass("ui-state-default").attr("id", id);
                var controls = $("<div>").addClass("player-controls");
                var rank = $("<span>").addClass("player-rank").text((index + 1) + ". ");
                var name = $("<span>").addClass("player-name").text(playersData[id]);
                var hideBtn = $("<button>").addClass("hide-btn").text("Hide");
                
                controls.append(rank);
                controls.append(name);
                controls.append(hideBtn);
                li.append(controls);
                
                $("#sortable").append(li);
            });
        }

        function populateEvents() {
            $("#events").empty();
            Object.keys(eventsData).forEach(function(eventId) {
                var eventName = eventsData[eventId];
                var matchInfo = matches.find(function(match) {
                    return match[5] == eventId;
                });
		var eventPrestige = matchInfo ? matchInfo[6] : 'majors';

                var eventDiv = $(
                    `<div id="event_${eventId}">
                        <label>${eventName}</label>
                        <input type="radio" name="prestige_${eventId}" value="majors" ${eventPrestige == 'majors' ? 'checked' : ''}>Majors
                        <input type="radio" name="prestige_${eventId}" value="regionals" ${eventPrestige == 'regionals' ? 'checked' : ''}>Regionals
                        <input type="radio" name="prestige_${eventId}" value="weeklies" ${eventPrestige == 'monthlies' ? 'checked' : ''}>Monthlies
                    </div>`
                );

                $("#events").append(eventDiv);

                $(`input[name="prestige_${eventId}"]`).change(function() {
                    updateMatches(eventId, $(this).val());
                    crossTableData = createCrossTableData(getFilteredMatches());
                    populateTable(crossTableData);
                });
            });
        }

        function populateMatchData() {
            $("#match-data").empty();
            for (var i = 0; i < matches.length; i++) {
                var match = matches[i];
                var eventId = match[5];
                var eventName = eventsData[eventId];
                var matchString = `${match[0]} > ${match[2]} ${match[4]} at ${eventName}`;

                var matchDiv = $(
		    `<div data-row-index="${i}">
                        <input type="radio" name="match-${i}" value="include" checked>Include
                        <input type="radio" name="match-${i}" value="exclude">Exclude
                        ${matchString}
                    </div>`
                );

		    crossTableData = createCrossTableData(getFilteredMatches());

            }

        function savePlayerOrder() {
            localStorage.setItem('ssbmrank_player_order', JSON.stringify(players));
        }

        function loadPlayerOrder() {
            var savedOrder = localStorage.getItem('ssbmrank_player_order');
            if (savedOrder) {
                try {
                    var parsedOrder = JSON.parse(savedOrder);
                    // Verify all saved players still exist in current players list
                    var currentPlayerIds = new Set(players);
                    var validSavedOrder = parsedOrder.filter(function(id) {
                        return currentPlayerIds.has(id);
                    });
                    
                    // Only use saved order if it contains all current players
                    if (validSavedOrder.length === players.length) {
                        players = validSavedOrder;
                        return true;
                    }
                } catch (e) {
                    console.log('Error loading saved player order:', e);
                }
            }
            return false;
        }

        function clearSavedOrder() {
            localStorage.removeItem('ssbmrank_player_order');
        }



        // Load saved player order before initializing
        loadPlayerOrder();

        var crossTableData = createCrossTableData(getFilteredMatches());
        populateTable(crossTableData);
        populatePlayerList();
        populateEvents();
        populateMatchData();

        $( "#sortable" ).sortable({
            tolerance: 'pointer',
            forceHelperSize: true,
            forcePlaceholderSize: true,
            placeholder: 'sortable-placeholder',
            stop: function(event, ui) {
                players = $("#sortable").sortable("toArray");
                populatePlayerList(); // Update rankings after reorder
                crossTableData = createCrossTableData(getFilteredMatches());
                populateTable(crossTableData);
                savePlayerOrder();
            }
        });

        // Player visibility controls
        $(document).on('click', '.hide-btn', function(e) {
            e.stopPropagation();
            var li = $(this).closest('li');
            li.toggleClass('hidden');
            
            if (li.hasClass('hidden')) {
                $(this).text('Show');
            } else {
                $(this).text('Hide');
            }
            
            crossTableData = createCrossTableData(getFilteredMatches());
            populateTable(crossTableData);
        });

        $("#hide-all-btn").click(function() {
            $("#sortable li").addClass('hidden');
            $("#sortable .hide-btn").text('Show');
            crossTableData = createCrossTableData(getFilteredMatches());
            populateTable(crossTableData);
        });

        $("#show-all-btn").click(function() {
            $("#sortable li").removeClass('hidden');
            $("#sortable .hide-btn").text('Hide');
            crossTableData = createCrossTableData(getFilteredMatches());
            populateTable(crossTableData);
        });

        $("#copy-list-btn").click(function() {
            var visiblePlayers = getVisiblePlayers();
            var playerList = visiblePlayers.map(function(id, index) {
                return (index + 1) + ". " + playersData[id];
            }).join('\n');
            
            navigator.clipboard.writeText(playerList).then(function() {
                var originalText = $("#copy-list-btn").text();
                $("#copy-list-btn").text('Copied!');
                setTimeout(function() {
                    $("#copy-list-btn").text(originalText);
                }, 2000);
            }).catch(function(err) {
                alert('Failed to copy to clipboard');
            });
        });

        // Modal functionality
        function showMatchModal(player1Id, player2Id) {
            var player1Name = playersData[player1Id];
            var player2Name = playersData[player2Id];
            var matches = getMatchesBetweenPlayers(player1Id, player2Id);
            
            $("#modalTitle").text(player1Name + " vs " + player2Name);
            
            if (matches.length === 0) {
                $("#modalBody").html('<div class="no-matches">No matches found between these players.</div>');
            } else {
                var html = "";
                matches.forEach(function(match) {
                    var eventName = eventsData[match[5]] || "Unknown Event";
                    html += '<div class="match-item">';
                    html += '<div><span class="match-winner">' + match[0] + '</span> defeated <span class="match-loser">' + match[2] + '</span></div>';
                    html += '<div class="match-score">Score: ' + match[4] + '</div>';
                    html += '<div class="match-event">at ' + eventName + '</div>';
                    html += '</div>';
                });
                $("#modalBody").html(html);
            }
            
            $("#matchModal").show();
        }

        function getMatchesBetweenPlayers(player1Id, player2Id) {
            var filteredMatches = getFilteredMatches();
            return filteredMatches.filter(function(match) {
                var winnerId = match[1];
                var loserId = match[3];
                return (winnerId === player1Id && loserId === player2Id) || 
                       (winnerId === player2Id && loserId === player1Id);
            });
        }

        // Click handler for cells
        $(document).on('click', '.clickable-cell', function() {
            var player1Id = $(this).attr('data-player1');
            var player2Id = $(this).attr('data-player2');
            showMatchModal(player1Id, player2Id);
        });

        // Close modal handlers
        $(".close").click(function() {
            $("#matchModal").hide();
        });

        $(window).click(function(event) {
            if (event.target.id === "matchModal") {
                $("#matchModal").hide();
            }
        });

        $("input[name='filter']").change(function() {
            crossTableData = createCrossTableData(getFilteredMatches());
            populateTable(crossTableData);
        });
      
    </script>

</body>
</html>
